class ToDoList extends Component {

    constructor(){
        super()
      
    }
   
    componentDidMount(){

        this.setState({})
    }

    render() {
        var myList = ['Shoping', 'Reading'];
        return (
<div>
    <h1> my list</h1>
<ul>
            {myList.map(function(name, index){
                return <li key={ index }>{name}</li>;
              })}
        </ul>
</div>
        
        );
    }
}

export default ToDoList;
